import axios from "axios"
import { useEffect } from "react"



axios.get('/api/post')
.then((response) => {
    console.log(response);
    const service = {
        getData: () => {
            return new Promise((res, rej) => {
                res({
                    count : response.length,
                    data : response
                })
            })
        }
    }
})



export default service;
